shell.menu_controller.add_menu_listener(ctx => {
  const light_theme = shell.breeze.is_light_theme();
  const icos = icons[light_theme ? 'light' : 'dark'];

  // Определяем функцию process_menus внутри замыкания, чтобы она имела доступ к light_theme и icos
  // Теперь она принимает объект menu, полученный из ctx.menu или из подменю
  const process_menus = (menu) => {
    try {
      // Итерируем по элементам текущего меню
      for (const menuItem of menu.get_items()) {
        try {
          const data = menuItem.data();

          // --- Логика определения иконки (остается без изменений) ---
          const origin_name_lower = data.origin_name ? data.origin_name.toLowerCase() : "null";
          const name_lower = data.name ? data.name.toLowerCase() : "null";
          let best_match = null;
          let max_matches = 0;

          for (const bt of icon_map_buttons()) {
            let matches = 0;
            for (const n of bt.name) {
              if (
                origin_name_lower.includes(n.toLowerCase()) ||
                name_lower.includes(n.toLowerCase())
              ) {
                matches++;
              }
            }
            if (matches > max_matches) {
              max_matches = matches;
              best_match = bt;
            }
          }

          let matched_ico = best_match?.icon;
          // --- Конец логики определения иконки ---

    // Проверяем, есть ли уже иконка у элемента

if (data.name?.includes("Открыть") || data.name?.includes("Open")){

const hasIcon = data.icon || data.icon_svg || data.icon_bitmap;

// Если иконки нет, но мы нашли подходящую — ставим её
if (!hasIcon && matched_ico && icos[matched_ico]) {

  shell.println('Пункт', data.origin_name);

    menuItem.set_data({
        icon_svg: icos[matched_ico],
        icon_bitmap: new shell.value_reset(),
    });
}}
else if (matched_ico && icos[matched_ico]){

  shell.println('Пункт', data.origin_name, '(', best_match?.name, ')');

  menuItem.set_data({
        icon_svg: icos[matched_ico],
        icon_bitmap: new shell.value_reset(),
    });
}
          

          // --- Рекурсивная обработка подменю ---
          // Проверяем, есть ли у текущего пункта меню подменю, определенное в данных
          // Предполагаем, что data.submenu - это функция, создающая/возвращающая меню
          if (data.submenu && typeof data.submenu === 'function') {

            // --- НАЧАЛО НОВОЙ ПРОВЕРКИ ---
          // Проверяем, является ли название пункта меню "Создать"
          // Учитываем разные языки и возможные пробелы/регистр, если нужно
          const isCreateMenu = data.name && data.name.trim().toLowerCase() === "создать" || data.name.trim().toLowerCase() === "create" || data.name.trim().toLowerCase() === "открыть с помощью" || data.name.trim().toLowerCase() === "open as" || data.name.trim().toLowerCase() === "open in";

          // Если это меню "Создать", пропускаем рекурсивную обработку его подменю
          if (isCreateMenu) {
            // Можно добавить логирование для отладки, если нужно
            // shell.println(`Skipping submenu processing for item: ${data.name}`);
            continue; // Переходим к следующему пункту меню
          }
          // --- КОНЕЦ НОВОЙ ПРОВЕРКИ ---

            // Сохраняем оригинальную функцию подменю
            const originalSubmenuFn = data.submenu;

            // Создаем оберточную функцию
            const wrappedSubmenuFn = (submenuWidgetOrMenuObject) => {
              // Сначала вызываем оригинальную функцию.
              // Она может инициализировать submenuWidgetOrMenuObject данными menu_data.
              const result = originalSubmenuFn(submenuWidgetOrMenuObject);

              // Теперь submenuWidgetOrMenuObject должен быть заполнен данными.
              // Предполагаем, что submenuWidgetOrMenuObject имеет метод init_from_data
              // или что это объект menu, к которому мы можем применить process_menus напрямую.
              // Наиболее вероятный сценарий для breeze-shell: submenuWidgetOrMenuObject
              // является объектом menu или виджетом menu_widget, к которому можно применить process_menus.
              // Попробуем оба варианта.

              // Попытка 1: Если submenuWidgetOrMenuObject сам является объектом menu (как ctx.menu)
              if (submenuWidgetOrMenuObject && typeof submenuWidgetOrMenuObject.get_items === 'function') {
                try {
                  process_menus(submenuWidgetOrMenuObject); // Рекурсивный вызов
                } catch (innerError) {
                  shell.println('icon replacer error processing submenu object (attempt 1):', innerError, innerError.stack);
                  // Попытка 2: Если это виджет menu_widget, возможно, нужно получить его menu_data
                  // или вызвать init_from_data позже. Этот путь сложнее без знания внутренностей.
                  // Оставим только первую попытку, так как она соответствует типичному API.
                }
              }
              // Если submenuWidgetOrMenuObject является виджетом menu_widget,
              // и он будет инициализирован данными позже через init_from_data,
              // наш внешний add_menu_listener сработает снова для него.
              // Поэтому дополнительная обертка здесь может быть избыточной.

              return result; // Возвращаем результат оригинальной функции
            };

            // Устанавливаем обернутую функцию обратно в данные пункта меню
            // Это должно перехватить вызов внутри C++ item.submenu.value()(submenu_wid)
            menuItem.set_data({ submenu: wrappedSubmenuFn });
          }


        } catch (itemError) {
          shell.println('icon replacer error processing individual menu item:', itemError, itemError.stack);
        }
      }
    } catch (menuError) {
       shell.println('icon replacer error accessing menu items list:', menuError, menuError.stack);
    }
  };

  try {
    // Запускаем обработку с корневого меню, переданного в ctx.menu
    // add_menu_listener гарантирует, что это происходит до init_from_data
    process_menus(ctx.menu);
  } catch (error) {
     shell.println('icon replacer error processing root menu:', error, error.stack);
  }
});